import React from 'react';
import ReactPlayer from 'react-player'

function SlideVideo(props) {
  return(
    <div className="slideVideo">
      <ReactPlayer
       className='react-player'
       url={props.video}
       playing
       volume={10}
       muted
       loop
       height='auto'
       width='100%'
      />
    </div>
  )
}

export default SlideVideo;
